import React from "react";
import TextField from '@material-ui/core/TextField';

const Form = () => {
    return(
        <>
            <div className = "center_div">
                <h1>Create a New Account</h1>
                <TextField id="standard-basic" label="Standard" />
            </div>
        </>
    )
}
